// Modal seleccionarasiento
import React from 'react';
import './seleccionar_asiento.css'; // Asegúrate de tener este archivo CSS para los estilos del modal

const seleccionar_asiento = ({ onClose }) => {
  return (
    <div className="seleccionar_asiento-overla">
      <div className="seleccionar_asiento-content">
        <h2>Seleccionar Asiento</h2>
        {/* Puedes agregar más contenido según sea necesario */}
        <button onClick={onClose}>Cerrar</button>
      </div>
    </div>
  );
};

export default seleccionar_asiento;
